import React from 'react';
import { Formik, Form, Field, ErrorMessage } from 'formik';
import { useNavigate } from 'react-router-dom';
import * as Yup from 'yup';
import { useDispatch, useSelector } from 'react-redux';
import { addContact } from './slices/contactsSlice';

const NewContactForm = () => {
  const navigate = useNavigate();
  const dispatch = useDispatch();
  const companies = useSelector((state) => state.companies.companies);
  const loggedInUserId = useSelector((state) => state.auth.user);
  console.log(loggedInUserId)
  const initialValues = {
    name: '',
    status: '',
    company_id: '',
    job_title: '',
    phone: '',
    email: '',
  };

  const validationSchema = Yup.object().shape({
    name: Yup.string()
      .required('Contact name is required')
      .matches(/^[A-Z][a-z]+(?: [A-Z][a-z]+)*$/, 'Name must start with a capital letter and contain only letters'),
    status: Yup.string()
      .required('Status is required')
      .oneOf(['Hot', 'Cold', 'Warm'], 'Invalid status selected'),
    company_id: Yup.number()
      .required('Company ID is required')
      .positive('Company ID must be positive')
      .integer('Company ID must be an integer'),
    job_title: Yup.number()
      .required('Job Title is required'),
    phone: Yup.string()
      .required('Phone number is required')
      .matches(/^\d{10}$/, 'Phone number must be 10 digits'),
    email: Yup.string()
      .required('Email is required')
      .email('Invalid email format'),
  });

  const onSubmit = (values, { resetForm }) => {
    if (loggedInUserId) {
      const companyData = { ...values, manager_id: loggedInUserId };
      dispatch(addContact(companyData));
      resetForm();
      navigate('/manage-contacts');
    } else {
      console.error("User ID is not available");
    }
  };

  const handleBack = () => {
    navigate('/manage-contacts');
  };

  return (
    <div className="card bg-base-100 shadow-xl p-8">
      <div className="card-body">
        <button onClick={handleBack} className="btn btn-accent btn-lg px-10 py-4 text-3xl mb-5">Back to Manage Contacts</button>
        <h1 className="card-title text-4xl mb-6">Add New Contact</h1>
        <Formik initialValues={initialValues} validationSchema={validationSchema} onSubmit={onSubmit}>
          {({ isSubmitting }) => (
            <Form>
              <div className="form-control w-full max-w-xs mb-4">
                <label htmlFor="name" className="label text-lg">Contact Name</label>
                <Field id="name" type="text" name="name" placeholder="Contact Name" className="input input-bordered input-lg w-full text-lg" />
                <ErrorMessage name="name" component="div" className="text-error text-lg" />
              </div>

              <div className="form-control w-full max-w-xs mb-4">
                <label htmlFor="status" className="label text-lg">Status</label>
                <Field as="select" name="status" className="select select-bordered select-lg w-full text-lg">
                  <option value="">Select Status</option>
                  <option value="Hot">Hot</option>
                  <option value="Cold">Cold</option>
                  <option value="Warm">Warm</option>
                </Field>
                <ErrorMessage name="status" component="div" className="text-error text-lg" />
              </div>

              <div className="form-control w-full max-w-xs mb-4">
                <label htmlFor="company_id" className="label text-lg">Company</label>
                <Field as="select" name="company_id" className="select select-bordered select-lg w-full text-lg">
                  <option value="">Select Company</option>
                  {companies.map((company) => (
                    <option key={company.id} value={company.id}>{company.name}</option>
                  ))}
                </Field>
                <ErrorMessage name="company_id" component="div" className="text-error text-lg" />
              </div>

              <div className="form-control w-full max-w-xs mb-4">
                <label htmlFor="job_title" className="label text-lg">Job Title</label>
                <Field id="job_title" name="job_title" placeholder="Job Title" className="input input-bordered input-lg w-full text-lg" />
                <ErrorMessage name="job_title" component="div" className="text-error text-lg" />
              </div>

              <div className="form-control w-full max-w-xs mb-4">
                <label htmlFor="phone" className="label text-lg">Phone</label>
                <Field id="phone" name="phone" placeholder="Phone Number" className="input input-bordered input-lg w-full text-lg" />
                <ErrorMessage name="phone" component="div" className="text-error text-lg" />
              </div>

              <div className="form-control w-full max-w-xs mb-4">
                <label htmlFor="email" className="label text-lg">Email</label>
                <Field id="email" name="email" placeholder="Email Address" className="input input-bordered input-lg w-full text-lg" />
                <ErrorMessage name="email" component="div" className="text-error text-lg" />
              </div>

              <button type="submit" disabled={isSubmitting} className="btn btn-primary btn-lg p-5 text-4xl flex justify-center items-center w-full">
                Submit
              </button>
            </Form>
          )}
        </Formik>
      </div>
    </div>
  );

};

export default NewContactForm;
